import { BrowserRouter, Route, Routes } from "react-router-dom";
import SwitchTabs from "./onBoarding";
import RegisterPage from "./registerPage";
import Login from "./login";
import Datafetch2 from "./axiosFetching";
import ConnectionPage from "./connectionPage";
import Datafetch from "./datafetching";
import Home from "./home";
import ProductsReviews from "./productReviews";

function App() {
    return (
        <BrowserRouter>
            <Routes>
                <Route path="/" element={<Home/>}/>
                <Route path="/products" element={<Datafetch/>}/>
                <Route path="/reviews" element={<ProductsReviews/>}/>
                
            </Routes>
        </BrowserRouter>
    );
}
export default App;
